import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Divider from '@mui/material/Divider';
import { motion } from 'framer-motion';
import { Image } from 'react-bootstrap';
import zadyn_pic from '../images/zadyn_pic.jpg';
// import StackedNavbar from '../StackedNavbar';

function Developers() {
  return (
    <motion.div 
      className='body-main'
      initial= {{opacity: 0}}
      animate = {{opacity: 1}}
      transition={{duration: 0.5, ease: 'easeOut'}}
      exit={{opacity: 0}}
    >
      <h1>Developers</h1>
      <Divider
        variant='middle'
        sx={{
          borderColor: 'white',
          width: '100%'
        }}
      >
      </Divider>
      <br></br>
      <div>
        <h2 style={{textWrap: 'wrap'}}>
        Meet the developers!
        </h2>
        <Image src={zadyn_pic} style={{height: '180px', width: '171px'}} roundedCircle/>
        <h3 style={{textWrap: 'wrap'}}>
          Zadyn Belgrave
        </h3>
      </div>
      <br></br>
      <Divider
        variant='middle'
        sx={{
          borderColor: 'white',
          width: '100%'
        }}
      >
      </Divider>
      {/* <StackedNavbar capacity='3' items='Developers, Projects, GitHub' /> */}
    </motion.div>
  );
}

export default Developers;
